 amet, consectetur adipisicing elit. Consequatur corporis culpa doloremque doloribus ducimus est inventore ipsum iste maiores, obcaecati perferendis perspiciatis possimus quas quo rem sed tempora totam voluptatem?</p>','Book 3','','trash','open','closed','','book-3__trashed','','','2018-02-21 17:40:45','2018-02-21 17:40:45','',0,'http://test1.local/?post_type=books&#038;p=59',0,'books','',0),(60,1,'2018-02-21 12:09:20','2018-02-21 12:09:20','drgdrgf','dfgrdfg','','trash','open','closed','','dfgrdfg__trashed','','','2018-02-21 12:23:29','2018-02-21 12:23:29','',0,'http://test1.local/?post_type=books&#038;p=60',0,'books','',0),(67,1,'2018-02-21 17:41:18','2018-02-21 17:41:18','<p>Set in the 1940s, the plot follows Henry Chinaski, Bukowski\'s perpetually unemployed, alcoholic alter ego, who has been rejected from the World War II draft and makes his way from one menial job to the next (hence a factotum). Chinaski drifts through the seedy city streets of lower-class Los Angeles in search of a job that will not come between him and his first love: writing. He is consistently rejected by the only publishing house he respects, but is driven to continue by the knowledge that he could do better than the authors they publish. Chinaski begins sleeping with fellow barfly Jan, a kindred spirit he meets while drowning his sorrows at a bar. When a brief stint as a bookie finds him abandoned by the only woman with whom he is able to relate, a fling with gold-digging floozie Laura finds him once again falling into a morose state of perpetual drunkenness and unemployment.\r\n</p>','Factotum','','publish','open','closed','','factotum','','','2018-02-28 08:26:03','2018-02-28 08:26:03','',0,'http://test1.local/?post_type=books&#038;p=67',0,'books','',0),(68,1,'2018-02-21 17:47:10','2018-02-21 17:47:10','','Factotum','','inherit','open','closed','','factotum-2','','','2018-02-21 17:47:10','2018-02-21 17:47:10','',67,'http://test1.local/wp-content/uploads/2018/02/Factotum.jpg',0,'attachment','image/jpeg',0),(69,1,'2018-02-21 17:59:40','2018-02-21 17:59:40','','Hamlet','','inherit','open','closed','','hamlet','','','2018-02-21 17:59:40','2018-02-21 17:59:40','',56,'http://test1.local/wp-content/uploads/2018/02/Hamlet.jpg',0,'attachment','image/jpeg',0),(70,1,'2018-02-21 18:10:14','2018-02-21 18:10:14','<p>This major new edition of Shakespeare\'s greatest tragedy of love argues that that play is ultimately Juliet\'s. The play text is expertly edited and the on-page commentary notes discuss issues of staging, theme, meaning and Shakespeare\'s use of his sources to give the reader deep and engaging insights into the play.</p>\r\n<p>The richly illustrated introduction looks at the play\'s exceptionally beautiful and complex language and focuses on the figure of Juliet as being at its centre. Rene Weis discusses the play\'s critical, stage and film history, including West Side Story and Baz Luhrmann\'s seminal film Romeo + Juliet. An authoritative edition from a leading scholar giving the reader a penetrating and wide-ranging insight into this ever popular play</p>','Romeo and Juliet','','publish','open','closed','','romeo-and-juliet','','','2018-03-01 14:55:27','2018-03-01 14:55:27','',0,'http://test1.local/?post_type=books&#038;p=70',0,'books','',0),(72,1,'2018-02-21 18:13:01','2018-02-21 18:13:01','','Fight-club','','inherit','open','closed','','fight-club','','','2018-02-21 18:13:01','2018-02-21 18:13:01','',55,'http://test1.local/wp-content/uploads/2018/02/Fight-club.jpg',0,'attachment','image/jpeg',0),(73,1,'2018-02-21 18:17:49','2018-02-21 18:17:49','<p>You probably associate Stephen King’s name with another brand of genre fiction, but that’s no reason to discount his forays past traditional horror. With The Dark Tower, King masterfully blends dark fantasy, western and horror across eight tales, which were released between 1982 and 2012. The story’s Wild West-esque environment might not appear to be the ideal landscape for fantasy, but the trials and travels of its main character, the Gunslinger, are more Lord of the Rings than Clint Eastwood. And though fans have different opinions on the best installments within the series, its continuity and whether it will receive the film adaptation it deserves, The Dark Tower series has proven worthy of its decades-spanning discussion. </p>','The Dark Tower','','publish','open','closed','','the-dark-tower','','','2018-02-28 08:25:50','2018-02-28 08:25:50','',0,'http://test1.local/?post_type=books&#038;p=73',0,'books','',0),(74,1,'2018-02-21 18:17:44','2018-02-21 18:17:44','','DarkTower','','inherit','open','closed','','darktower','','','2018-02-21 18:17:44','2018-02-21 18:17:44','',73,'http://test1.local/wp-content/uploads/2018/02/DarkTower.jpeg',0,'attachment','image/jpeg',0),(75,1,'2018-02-21 18:19:13','2018-02-21 18:19:13','<p>J.R.R. Tolkien spent a dozen years building the world of Middle Earth between The Hobbit’s publication and the completion of Frodo’s epic journey to Mordor in The Return of the King. Every location the Fellowship encountered possessed a rich history and language, showcasing songs and poetry and mythology that always spoke of more beyond the page. But it was the four simple hobbits, bravely facing a world far larger and darker than their home in the Shire, that made every strange encounter relatable. Fighting orcs and spiders and worse, there was a nobility inverse to their size and a struggle between good and evil that resonates 62 years later.</p>','The Lord of the Rings','','publish','open','closed','','the-lord-of-the-rings','','','2018-02-28 08:25:45','2018-02-28 08:25:45','',0,'http://test1.local/?post_type=books&#038;p=75',0,'books','',0),(76,1,'2018-02-21 18:19:10','2018-02-21 18:19:10','','LordoftheRings','','inherit','open','closed','','lordoftherings','','','2018-02-21 18:19:10','2018-02-21 18:19:10','',75,'http://test1.local/wp-content/uploads/2018/02/LordoftheRings.jpg',0,'attachment','image/jpeg',0),(77,1,'2018-02-21 18:43:33','201